    "contracts/SignaturePresale.sol": {
      "content": "//SPDX-License-Identifier: MIT
pragma solidity 0.8.11;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "hardhat/console.sol";
import {TokenVesting} from "./TokenVesting.sol";

import {Token} from "./Token.sol";


contract SignaturePresale is Ownable, ReentrancyGuard {
    using ECDSA for bytes32;
    address private _systemAddress;
    mapping(string => bool) public _usedNonces;
    TokenVesting private _tokenVesting;
    Token private _token;

    function init(
        address systemAddress_,
        address payable tokenVestingAddress_,
        address tokenAddress_
    ) external onlyOwner {
        _systemAddress = systemAddress_;
        _tokenVesting = TokenVesting(tokenVestingAddress_);
        _token = Token(tokenAddress_);
    }

    function publicSale(uint256 amount,
        string memory nonce,
        bytes32 hash,
        bytes memory signature
    ) external nonReentrant payable {
        //signature realted
        require(matchSigner(hash, signature), "Plz mint through website");
        require(!_usedNonces[nonce], "Hash reused");
        require(
            hashTransaction(msg.sender, amount, nonce) == hash,
            "Hash failed"
        );
        _usedNonces[nonce] = true;
        require(msg.value >= amount, "SignatureWhitelist:not enough token!");
        _tokenVesting.buyVesting{value : amount}(msg.sender);
    }

    function matchSigner(bytes32 hash, bytes memory signature) private view returns (bool) {
        return _systemAddress == hash.toEthSignedMessageHash().recover(signature);
    }

    function hashTransaction(address sender,
        uint256 amount,
        string memory nonce
    ) private view returns (bytes32) {
        bytes32 hash = keccak256(
            abi.encodePacked(sender, amount, nonce, address(this))
        );
        return hash;
    }
}
"
